import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import Login from './pages/Login';
import Register from './pages/Register';
import Home from './pages/Home';
import Dashboard from './components/Dashboard';
import BudgetManager from './components/BudgetManager';
import MonthlyAnalyticsDashboard from './components/MonthlyAnalyticsDashboard';
import CategoryManager from './components/CategoryManager';
import Settings from './pages/Settings';
import { AuthProvider } from './context/AuthContext';
import { useAuth } from './hooks/useAuth';

function PrivateRoute({ children }) {
  const { token } = useAuth();
  return token ? children : <Navigate to="/login" />;
}

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="app">
          <Routes>
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/" element={<PrivateRoute><Home /></PrivateRoute>} />
            <Route path="/dashboard" element={<PrivateRoute><Dashboard /></PrivateRoute>} />
            <Route path="/budgets" element={<PrivateRoute><BudgetManager /></PrivateRoute>} />
            <Route path="/analytics" element={<PrivateRoute><MonthlyAnalyticsDashboard /></PrivateRoute>} />
            <Route path="/categories" element={<PrivateRoute><CategoryManager /></PrivateRoute>} />
            <Route path="/settings" element={<PrivateRoute><Settings /></PrivateRoute>} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
